import React from 'react';
import './HeroPhone.css';
import phoneImage from '../assets/logo.png';     // mascot + bottom image
import phoneImage2 from '../assets/logo2.png';   // hoverable screen

const HeroPhone = () => {
  return (
    <div className="hero-wrapper">
      <img
        src={phoneImage}
        alt="Mascot"
        className="mascot-img"
      />

      <div className="card">
        <div className="btn1"></div>
        <div className="btn2"></div>
        <div className="btn3"></div>
        <div className="btn4"></div>

        <div className="card-int">
          <div className="hello">
            <img src={phoneImage2} alt="Hover Image" className="hover-img" />
            <span className="hover-text">Join</span>
          </div>
        </div>

        <div className="top">
          <div className="camera"><div className="int"></div></div>
          <div className="speaker"></div>
        </div>
      </div>
    </div>
  );
};

export default HeroPhone;
